    <div class="bottomDate"></div>
    <script>
        setInterval(() => {
            var a = new Date();
            var hour = a.getHours();
            var minute = a.getMinutes().toString().length === 1 ? `0${a.getMinutes()}` : a.getMinutes();
            var second = a.getSeconds().toString().length === 1 ? `0${a.getSeconds()}` : a.getSeconds();
            document.querySelector('.bottomDate').innerHTML = `${a.getFullYear()}-${a.getMonth() + 1}-${a.getDate()}&nbsp;&nbsp;${hour} : ${minute} : ${second}`;
            document.querySelector('.topDate').innerHTML = `${hour} : ${minute}`;
        }, 100)
    </script>
